import { StyleSheet } from "react-native";

export default styles = StyleSheet.create({
    container: {
        margin: 5,
    },
    header2: {
        fontSize: 26,
    },
    header3: {
        fontSize: 22,
        textAlign: 'right',
    },
    text: {
        padding: 5,
        fontSize: 18,
        textAlign: 'center',
    }
});
